import React from 'react';
import ThemeToggleButton from './ThemeToggleButton';

const App: React.FC = () => {
  return (
    <div>
      <header>
        <h1>My React App</h1>
        <ThemeToggleButton />
      </header>
      <main>
        <p>Content of your app goes here.</p>
      </main>
    </div>
  );
};

export default App;
